import { Button, Card, Typography, Box, Grid } from "@mui/material";
import { Fragment, useState } from "react";
import UserCard from "./UserCard";




export default function List() {

    const style =

    {
        div: {
            background: "lightBlue",
            padding: "10px",
            textAlign: "center",

        },
        box: {
            justifyContent: "center",
            display: "flex",
            marginTop: "20px"
        }
    }

    const [users, setUsers] = useState([
        {
            "nombre": "mateo",
            "apellido": "gonzalez",
            "dni": 44969246
        },
        {
            "nombre": "jose",
            "apellido": "perez",
            "dni": 11787567
        },
        {
            "nombre": "tata",
            "apellido": "tete",
            "dni": "44111333"
        },
        {
            "nombre": "felipe",
            "apellido": "bocelo",
            "dni": 45654765
        },
        {
            "nombre": "ramiro",
            "apellido": "moya",
            "dni": 45653212
        }
    ]
    )

    return (

        <Fragment>

            <h1>Usuarios</h1>
            {users.map(user => {
                return (
                    <Box sx={{ flexGrow: 1 }} style={style.box}>

                        <Grid container spacing={2}>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.nombre}
                                </div>


                            </Grid>
                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.apellido}
                                </div>


                            </Grid>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    DNI
                                </div>

                            </Grid>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    Fecha Nacimiento
                                </div>

                            </Grid>

                        </Grid>

                    </Box>
                )
            })}

        </Fragment>
    )

}
